import request from '@/utils/request'

// 获取健康评估详情
export function getHealthAssessmentDetail(assessmentId) {
    return request({
        url: '/api/health-assessment/detail',
        method: 'get',
        params: {
            assessment_id: assessmentId
        }
    })
}

// 提交健康评估
export function submitHealthAssessment(data) {
    return request({
        url: '/api/health-assessment/submit',
        method: 'post',
        data
    })
}
